import React from "react";
import { LineWave } from "react-loader-spinner";
import styled from "styled-components";


const SpinnerBox = styled.div`
    width: 100%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
    margin-bottom: ${(props)=>props.marginBottom};
`;

export default function LoadingSpinner({marginBottom}) {

    console.log(marginBottom);

  return (
    <SpinnerBox marginBottom={marginBottom}>
        <LineWave
        height="100"
        width="100"
        color="##dbdde9"
        ariaLabel="line-wave"
        wrapperStyle={{}}
        wrapperClass=""
        visible={true}
        firstLineColor=""
        middleLineColor=""
        lastLineColor=""
      />
    </SpinnerBox>
  );
}
